import React from 'react'
import { graphql, useStaticQuery } from 'gatsby';
import { Container } from 'react-bootstrap';
import Img from "gatsby-image"

const MainImage = () => {
    const data = useStaticQuery(graphql`
    query {
        mobileImage: file(relativePath: { eq: "homepage/playstation-mobile.png" }) {
          childImageSharp {
            fluid(maxWidth: 1000, quality: 100) {
              ...GatsbyImageSharpFluid
            }
          }
        }
        desktopImage: file(
          relativePath: { eq: "homepage/playstation.png" }
        ) {
          childImageSharp {
            fluid(maxWidth: 2000, quality: 100) {
              ...GatsbyImageSharpFluid
            }
          }
        }
      }       
    `)
    const sources = [
        data.mobileImage.childImageSharp.fluid,
        {
            ...data.desktopImage.childImageSharp.fluid,
            media: `(min-width: 768px)`,
        },
    ]
    return (
        <Img fluid={sources} />
    )
}


interface Props { }
const section = (props: Props) => {
    return (
        <div className="" id="testDivID" style={{position:"relative"}}>
            <MainImage />
            <div className="" style={{position:"absolute", top:50, left:50}}>
                <h1 style={{color:"#555"}}>GIVEAWAY</h1>
            </div>
            <div className="-flex-col- -aln-c- -px-20--xm-dn- mx-auto" style={{ textAlign: "center" }}>
                <div className="-flex-col- -aln-c-" style={{ maxWidth: 400 }}>
                    <h2 className="mx-auto" >
                        12 Days of Christmas giveaway
                </h2>
                    <div className="-my-20- -my-30--sm-up- -flex-col- -aln-c-" style={{ borderStyle: "solid", borderLeftWidth: 0, borderRight: 0, borderTopWidth: 3, borderBottomWidth: 3, maxWidth: 300 }}>
                        <h4>
                            PLAYSTATION, TRENDING GAMES
                            PLAYSTATION
                            
                            </h4>
                    </div>
                    <p>
                        We are ready to light up your christmas in
                </p>
                </div>
            </div>
        </div>
    )
}

export default section;
